description:
Verenigde Staten
Thriller
108 minuten

goed

met Kelen Coleman, Kevin Alejandro en Rus Blackwell

Een doof meisje probeert via een seance contact te leggen met haar jongere zus die door een ongeluk om het leven is gekomen. 
Wat ze niet weet is dat ze echter contact legt met de geest van een vermoorde vrouw die op wraak uit is.
